import React from 'react';

const TableHead = (props) => {
    //console.log(props);
const {columns}=props;
    return (
        <>
            <thead className="table-dark">
            <tr>
                {
                    props.columns.map
                }
            </tr>
            </thead>
        </>
    );
};

export default TableHead;
